import React, { useEffect, useState } from "react";
import { APIProvider, Map, Marker } from '@vis.gl/react-google-maps';
import { Link } from "react-router-dom";
import logo from './logo.png';

const AddProperty = () => {
    const [markers, setMarkers] = useState([]);
    const [height, setHeight] = useState(0); // Height state
    const position = { lat: 6.8214925581511565, lng: 80.04122509763354 };

    const ClearOutput = () => {
        // Clear form inputs and markers
        setMarkers([]);
    };

    useEffect(() => {
        const column2 = document.getElementById('column_two');
        if (column2) {
            setHeight(column2.offsetHeight);
        }
    }, []);

    const handleMapClick = (event) => {
        if (event && event.detail && event.detail.latLng) {
            const clickedPosition = {
                lat: event.detail.latLng.lat,
                lng: event.detail.latLng.lng
            };
            setMarkers([...markers, clickedPosition]);
        }
    };

    return (
        <APIProvider apiKey={"YOUR_API_KEY"}>
            <>
                <nav>
                    <div className="logo">
                        <img src={logo} alt="Logo" width="100" height="100" />
                    </div>
                    <Link to="/Home" title="Home"><b>Home</b></Link>
                    <Link to="/WardenDashbord" title="Dashboard"><b>Dashboard</b></Link>
                    <Link to="/WardenProfile" title="Profile"><b>Profile</b></Link>
                    <Link to="/WardenProperty" title="Reservations"><b>Property</b></Link>
                    <Link to="/Home" title="Profile" style={{ marginRight: '-10px' }}><b>Sign Out</b></Link>
                </nav>

                <div className="container">
                    <section className="sidebar">
                        <Link className="link f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" to="/LandlordDashbord" title="LandlordDashbord">Dashboard</Link>
                        <Link className="link f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" to="/LandlordProfile" title="LandlordProfile">Profile</Link>
                        <Link className="link f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" to="/AddProperty" title="AddProperty">Property</Link>
                        <a className="f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" href="#0">Log Out</a>
                    </section>

                    <section className="main">
                        <button className="toggle-button">Hide Blocks</button>
                        <h1 className="center">Add New Property</h1>
                        <form className="form">
                            <div className="form-group">
                                <label htmlFor="Property_Name">Property Name</label>
                                <input type="text" id="Property_Name" />
                            </div>
                            {/* Add other form inputs similarly */}
                            <button className="btn-submit" type="submit">Add</button>
                            <button className="btn-clear" type="reset" onClick={ClearOutput}>Clear</button>
                        </form>
                        <div className="map-container">
                            <h4>Enter Location</h4>
                            <div className="map">
                                <Map defaultCenter={position} defaultZoom={15} onClick={handleMapClick}>
                                    {markers.map((marker, index) => (
                                        <Marker key={index} position={marker} />
                                    ))}
                                </Map>
                            </div>
                        </div>
                    </section>
                </div>

                <footer className="footer">
                    <small className="copyright">© Created by Group CC, All Rights Reserved.</small>
                </footer>
            </>
        </APIProvider>
    );
}

export default AddProperty;
